attributes.cssVariables:
:root {
  --background: var(--boxel-light);
  --foreground: var(--boxel-dark);
  --card: var(--boxel-light);
  --card-foreground: var(--boxel-dark);
  --popover: var(--boxel-light);
  --popover-foreground: var(--boxel-dark);
  --primary: var(--boxel-highlight, #00ffba);
  --primary-foreground: var(--boxel-dark);
  --secondary: var(--boxel-dark);
  --secondary-foreground: var(--boxel-light);
  --muted: var(--boxel-100, #f8f7fa);
  --muted-foreground: var(--boxel-700, #272330);
  --accent: var(--boxel-200, #e8e8e8);
  --accent-foreground: var(--boxel-dark);
  --destructive: var(--boxel-danger, #ff5050);
  --destructive-foreground: var(--boxel-light);
  --border: var(--boxel-border-color, #d3d3d3);
  --input: var(--boxel-light);
  --ring: var(--boxel-highlight, #00ffba);
  --sidebar: var(--boxel-light);
  --sidebar-foreground: var(--boxel-dark);
  --sidebar-primary: var(--boxel-dark);
  --sidebar-primary-foreground: var(--boxel-light);
  --sidebar-accent: var(--boxel-200, #e8e8e8);;
  --sidebar-accent-foreground: var(--boxel-dark);
  --sidebar-border: var(--boxel-border-color, #d3d3d3);
  --sidebar-ring: var(--boxel-highlight, #00ffba);
  --font-sans: var(--boxel-font-family, Poppins, sans-serif);
  --font-serif: Playfair Display, ui-serif, serif;
  --font-mono: var(--boxel-monospace-font-family, Roboto Mono, monospace);
  --radius: var(--boxel-border-radius, 0.625rem);
  --shadow: var(--boxel-box-shadow, 0 1px 3px 0 rgba(0 0 0 / 25%));
  --shadow-lg: var(--boxel-box-shadow-hover, 0 3px 10px 0 rgba(0 0 0 / 15%));
  --shadow-xl: var(--boxel-deep-box-shadow, 0 5px 15px 0 rgba(0 0 0 / 50%));
  --tracking-normal: var(--boxel-lsp-xs, 0.01em);
  --spacing: var(--boxel-sp-6xs, 0.135rem);
}
